import React, {Component} from 'react';
import './App.css';
import ParticlesBg from 'particles-bg';
import Navigation from './Components/Navigation/Navigation';
import URLinput from './Components/URLinput/URLinput';

class App extends Component {
  constructor() {
    super()
  }

  render() {
    return (
      <div className="App">
        <ParticlesBg type="cobweb" bg={{position: "absolute", zIndex: -1, top: 0, left: 0}} className="particles-bg"/>
        <Navigation />
        <URLinput />
        <h1>Hello There</h1>
      </div>
    );
  }
}

export default App;
